// 
function daojishi(shijiancha){
     var hours=shijiancha/1000/3600;
     var hoursRound=Math.floor(hours);
     var minutes=shijiancha/1000/60-(60*hoursRound);
     var minutesRound=Math.floor(minutes);
     var seconds=shijiancha/1000-(hoursRound*3600)-(minutesRound*60)
     var secondsRound=Math.floor(seconds);
     var ggg=[];
     if(hoursRound<10&&hoursRound>0){
         hoursRound="0"+hoursRound
     }else if(hoursRound<0){
        hoursRound="0"+0
     }
     if(minutesRound<10){
         minutesRound="0"+minutesRound
     }
     if(secondsRound<10){
         secondsRound="0"+secondsRound
     }
     ggg.push(hoursRound);
     ggg.push(minutesRound);
     ggg.push(secondsRound);
     return ggg;
}


